import React from "react";
function Todo({ text, todo, todos, setTodos }) {
  const deleteHandler = () => {
    setTodos(todos.filter((el) => el.id !== todos.id));
  };
  return (
    <div className="todo">
      <li className="todo-item">{text}</li>
      <button>completed</button>
      <button onClick={deleteHandler}>delete</button>
    </div>
  );
}

export default Todo;
